import Link from 'next/link'
const NavBar=()=>(
<div>
    <ul>
    <li>
        <a>
        <Link href="/">Home</Link>
        </a>
    </li>
    <li>
        <a>
        <Link href="/about">About</Link>
        </a>
    </li>
</ul>

<style jsx>
    {`
    ul{
        background: #333;
        color: #fff;
        list-style: none;
        display: flex;
    }

     ul li{
        font-size: 28px;
        margin-right: 20px;
    }

    ul li a{
        color: #fff;
        text-decoration: none;
    }
    a:active{
        color:white;
    }`
    }
</style>
</div>
)
export default NavBar
